import React, { useState } from 'react';
import Drawer from '@/components/Drawer';
import Cart from './Cart';
import Navigation from '@/components/Navigation';
import Product from '@/components/Product';
import Banner from '@/components/Banner';
import Collection from './Category';
import Gaurantees from './Gaurantees';
import Footer from '@/components/Footer';

import WatchImg from '@/assets/images/products/item5.jpeg';
import ClothesImg from '@/assets/images/products/item6.jpeg';
import ShoesImg from '@/assets/images/products/item7.jpeg';
import GlovesImg from '@/assets/images/products/item10.jpeg';

function Home() {
  const [state, setState] = useState({
    isShopingCartOpen: false,
    newArrivals: [
      {
        id: '1',
        name: 'React Note',
        price: 2000,
        info: 'Lorem ipsum dolor sit amet',
        avg_stars: 4,
        total_reviews: 200,
      },
      {
        id: '2',
        name: 'React Product 2',
        price: 13000,
        info: 'Lorem ipsum dolor sit amet',
        avg_stars: 4,
        total_reviews: 5,
      },
      {
        id: '3',
        name: 'React Product 3',
        price: 4000,
        info: 'Lorem ipsum dolor sit amet',
        avg_stars: 2,
        total_reviews: 10,
      },
      {
        id: '4',
        name: 'React Product 4',
        price: 5000,
        info: 'Lorem ipsum dolor sit amet',
        avg_stars: 1,
        total_reviews: 10,
      },
    ],
    categories: [
      {
        id: '1',
        name: 'Watch',
        to: '#',
        img: WatchImg,
      },
      {
        id: '2',
        name: 'Clothes',
        to: '#',
        img: ClothesImg,
      },
      {
        id: '3',
        name: 'Shoes',
        to: '#',
        img: ShoesImg,
      },
      {
        id: '4',
        name: 'Gloves',
        to: '#',
        img: GlovesImg,
      },
    ],
    cartItems: [],
  });

  const { isShopingCartOpen, newArrivals, categories, cartItems } = state;

  const handleCartClick = () => {
    setState({
      ...state,
      isShopingCartOpen: !isShopingCartOpen,
    });
  };

  const handleProductCartClick = (id) => {
    if (cartItems.find((item) => item.id === id)) {
      setState({
        ...state,
        cartItems: cartItems.map((item) => (item.id === id ? { ...item, count: item.count + 1 } : item)),
      });
    } else {
      const selectedProduct = newArrivals.find((item) => item.id === id);
      setState({
        ...state,
        cartItems: [...cartItems, { ...selectedProduct, count: 1 }],
      });
    }
  };

  const handleCartItemRemoveClick = (id) => {
    setState({
      ...state,
      cartItems: cartItems.filter((item) => item.id !== id),
    });
  };

  const handleCheckout = ({ items, totalPrice }) => {
    console.log(`Checkout ${JSON.stringify(items)} total: ${totalPrice}`);
  };

  return (
    <>
      <Drawer isOpen={isShopingCartOpen}>
        <Cart
          items={cartItems}
          onClose={handleCartClick}
          onRemoveClick={handleCartItemRemoveClick}
          onCheckout={handleCheckout}
        />
      </Drawer>
      <Navigation cartItemCounts={cartItems.length} onCartClick={handleCartClick} />
      <main>
        <Banner />
        <section className="new-arrivals container">
          <div className="row copy">
            <div className="col-12 text-center mt-5">
              <div className="navy-line"></div>
              <h1>NEW ARRIVALS</h1>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
            </div>
          </div>
          <div className="row items">
            {newArrivals.map((product) => (
              <div key={product.id} className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                <Product product={product} onCartClick={handleProductCartClick} />
              </div>
            ))}
          </div>
        </section>
        <section className="featured-collection container my-5">
          <div className="row copy">
            <div className="col-12 text-center">
              <div className="navy-line"></div>
              <h1>FEATURED COLLECTION</h1>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
            </div>
          </div>
          <div className="row">
            {categories.map((collection) => (
              <div key={collection.id} className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                <Collection name={collection.name} to={collection.name} img={collection.img} alt={collection.name} />
              </div>
            ))}
          </div>
        </section>
        <section className="explore flex-fill bg-light my-5 py-4 text-center">
          <h3 className="mb-3">
            Over <strong>50.000</strong> digital products!
          </h3>
          <a className="btn btn-rounded btn-noborder btn-lg btn-primary" href="#products">
            Explore Store <i className="fas fa-arrow-right"></i>
          </a>
        </section>
        <Gaurantees />
      </main>
      <Footer />
    </>
  );
}

export default Home;
